import ReactDOM from 'react-dom'
import React from 'react'
import './index.css'
import AppBar from './AppBar.js'
import Pricing from './Pricing.js'
import Temple from './img/temple-minimal.png'

function Homepage() {
    return (
        [
            <AppBar />,
            <div><a href="/pricing.html">hey</a></div>
        ]
    )
}

function PricingPage() {
    return (
        [
            <AppBar />,
            <Pricing />
        ]
    )
}



ReactDOM.render(
    [
        <Homepage />,
        <Pricing />
    ],
    document.getElementById('root')
);
